import React, { useState } from 'react';
// services 
import { storeBooking } from '../../services/booking.service';

const Component = (props) => {
	const [isOpen,setIsOpen] = props.open
	const [status,setStatus] = useState('');
	const [description,setDescription] = useState('');

	const handleSend  = () => {
		console.log(status,description);
		storeBooking(status,description).then((response)=>{
			console.log(response)
		}).catch((error)=>{
			console.log(error);
		})
	}

	return (
		<div
			style={{
				display:isOpen?'block':'none'
			}}
		>
			<label>
				status : <input onChange={(next)=>setStatus(next)}/>
			</label>
			<label>
				description: <input onChange={(next)=>setStatus(next)} />
			</label>
			<button onClick={handleSend}>
				send
			</button>
		</div>
	)
}

export default Component;
